import React from "react";
export default function Footer() {
  return (
    <div className="footer">
      <div class="footer__social">
        <a
          href="https://www.linkedin.com/in/mohamed-amiir/"
          class="footer__social-icon"
        >
          {/* <i class="bx bxl-linkedin"></i> */}
        </a>
        <a href="https://github.com/Mohamed22198" class="footer__social-icon">
          {/* <i class="bx bxl-github"></i> */}
        </a>
        <a href="https://wa.me/+201099523542" class="footer__social-icon">
          <i class="bx bxl-whatsapp"></i>
        </a>
        <a
          href="https://www.facebook.com/profile.php?id=100009078180663"
          class="footer__social-icon"
        >
          {/* <i class="bx bxl-facebook"></i> */}
        </a>
      </div>
    </div>
  );
}
